require 'benchmark'
#@param {Integer[]} height
#@return {Integer}
def max_area(height)
  max = 0
  i = 0
  j = 0
  length = height.length
  while i < length
    j = i + 1
    while j < length
      area = (j - i) * [height[i], height[j]].min
      max = area if area > max
      j += 1
    end
    i += 1
  end
  puts max
  max
end

#@param {Integer[]} height
#@return {Integer}
def max_area_2(height)
  max = 0
  height.each_with_index do |h, i|
    height[i + 1..-1].each_with_index do |h2, j|
      area = (j + 1) * [h, h2].min
      max = area if area > max
    end
  end
  puts max
  max
end

#@param {Integer[]} height
#@return {Integer}
def max_area_3(height)
  maxes = height.max(2)
  max = maxes[0] * (height.length - 1)
  max = maxes[1] * (height.length - 2) if maxes[1] * (height.length - 2) > max
  puts max
  max
end




